// import React, { Fragment } from "react";

/* Components */
import { AboutSection } from './aboutSection'

/* Styles */
import './content.scss';

/* Images */
import almOpImg from '../../../imgs/home/opinion-sect01.png';

export function Content() {
    return (
        <div className="homeContent">
            <AboutSection />
            <div className="opinionSection">
                <div className="container">
                    <h3>ASI OPINAN NUESTROS ALUMNOS Y GRADUADOS</h3>
                    <div className="cards-container">
                        <div className="cards">
                            <div className="card">
                                <img src={almOpImg} alt=""/>
                                <div className="card-content">
                                    <h3>ALUMNA</h3>
                                    <h1>La institucion es muy divertida</h1>
                                    <p>Aenean nec neque sem. Nam molestie nunc nec lectus feugiat, id pretium nisl sollicitudin. Donec ut pharetra lectus. Aliquam massa odio, viverra in dictum et, aliquam et eros. Mauris at augue dapibus, viverra leo nec, aliquet ligula. Mauris quis vestibulum nibh. Curabitur eu augue volutpat tellus pretium suscipit.</p>
                                </div>
                            </div>
                        </div>
                        <div className="pagination">
                            <button>1</button>
                        </div>
                    </div>
                </div>
            </div>
            <div className="eventSection"></div>
        </div>
    );
}
